import styled from 'styled-components';


export default function SignIn() {
 
  const Container = styled.h1`
  font-size: 1.5em;
  text-align: center;
  color: palevioletred;
`;


  return (
    <Container>
      <form >
        <label>Login</label>
        <br></br>
        <label>
          E-mail:
          <input type="text" name="Email"/>
        </label>
        <label>
          Senha:
          <input type="password" name="Email"/>
        </label>
      </form>
    </Container>
  );
}
